import React, { Component } from "react";
import './App.css';

const customers = [
  {
    id: 1,
    name: "Anna",
    surname: "Malinoska",
    age: 54
  },
  {
    id: 2,
    name: "Maciej",
    surname: "Wi",
    age: 54
  },
  {
    id: 3,
    name: "Anna",
    surname: "Malinoska",
    age: 54
  },

];
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      customersList: customers
    };
  }
}

export default App;
